            lng={13.7668}>
            <BtnStyle>
                <button onClick= {() => {
                    <div>HEJ</div>
                    }}
                    className="crime-marker" asd> 
                    <img className = "person" src={bike} alt="person"/>
                </button>
            </BtnStyle>
        </Marker>
        </div>
	);
}
